const Modal = (props) => {
  return (
    <>
    <div className="modal" id={props.id} data-bs-backdrop='static' data-bs-keyboard='false' tabindex='-1' aria-labelledby="staticBackdropLabel" aria-hidden='true'>
        <div className="modal-dialog">
            <div className="modal-content">
                <div className="modal-header">
                    <h1 className="modal-title fs-5" id="staticBackdropLabel">{props.title}</h1>
                    <button type="button" className="btn-close" data-bs-dismiss aria-label="Close"></button>
                </div>
                <div className="modal-body">
                    {props.children}
                </div>
            </div>
        </div>
    </div>
    </>
  );
};
export default Modal;
